import React from "react";
// import { NavLink } from "react-router-dom";
import web from '../src/images/bg1.svg';
const Home = () => {
  return (
    <>
      <section id="header" className="">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
            <div className="row">
              <div className="col-md-6 pt-lg-0 order-lg-1">
                <h1>Grow Your Business With <strong className="brand-name">Harsh rathod</strong></h1>
                <p className="my-3">We are the team of the talanted developer making website</p>
                <div className="mt-3">
                  <a href="" className="btn btn-outline-primary">Get Started</a>
                </div>
              </div>
              <div className="col-lg-6 order-1 order-lg-2 header-img">
                {/* <img src={web} className="img-fluid animated" alt="home_png"/> */}
              </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>);
}
export default Home;
